PageFeedItemServiceBulkOutput:
  type: string
  nullable: true
  enum:
  - CSV
  - TSV
  - ZIPPED_CSV
  - ZIPPED_TSV
  - UNKNOWN
  title: PageFeedItemServiceBulkOutput
  description: |
    <div lang="ja">PageFeedItemServiceBulkOutputは、ページフィードアイテムファイル形式を指定します。<br>
    このフィールドは省略可能です。<br>
    デフォルト設定値はCSVとなります。</div>
    <div lang="en">PageFeedItemServiceBulkOutput specifies format of Page feed item file.<br>
    This field is optional.<br>
    The default value will be CSV.</div>
    <hr>
    <dl class=term>
      <dt class="term__item">CSV</dt>
      <dd class="term__desc"><span lang="ja">CSV形式</span><span lang="en">Format of CSV</span></dd>
      <dt class="term__item">TSV</dt>
      <dd class="term__desc"><span lang="ja">TSV形式</span><span lang="en">Format of TSV</span></dd>
      <dt class="term__item">ZIPPED_CSV</dt>
      <dd class="term__desc"><span lang="ja">ZIP圧縮されたCSV形式</span><span lang="en">Zipped CSV.</span></dd>
      <dt class="term__item">ZIPPED_TSV</dt>
      <dd class="term__desc"><span lang="ja">ZIP圧縮されたTSV形式</span><span lang="en">Zipped TSV.</span></dd>
      <dt class="term__item">UNKNOWN</dt>
      <dd class="term__desc"><span lang="ja">未知の値です。</span><span lang="en">Unknown Value</span></dd>
    </dl>
